node.text:
Un anno, a pensarci mi viene da ridere perché non ho mai condiviso tanto in un anno con una persona, non a caso le persone rimangono spiazzate quando diciamo da quando stiamo insieme, tante volte non ci credo neanche io. Chissà, forse avremo sbagliato a bruciare alcune tappe, forse avrò sbagliato io a permettertelo, forse ci siamo incasinati la vita e basta, forse se avessimo preso decisioni diverse non ci saremmo fatti tanto male.. ma sai che c’è? Io dei forse me ne frego, me ne frego di chi mi dice che abbiamo fatto passo troppo lunghi, di chi mi dice che verte situazione ce le siamo cercate e meritate, chi ci dice che non avremmo durato due giorni perché alla fine, nonostante tutte le situazione che ci sono state, sfido chiunque a dire di avere un rapporto come il nostro, un rapporto in costante crescita, che sente il bisogno di cercarsi e volersi, un rapporto che dopo tutte le pedate che gli abbiamo dato sta in piedi così, ancorato come se avesse le radici talmente tanto profonde che non cade neanche con i fulmini, perché in fondo si sa, tutti sbagliamo, l’importante è saper rimanere in piedi e continuare a crederci. Non ti cambierei con nessuno, neanche per tutta la tranquillità del mondo. ❤️🔥 💘𝒩𝑜𝓉  𝑜𝓃𝓁𝓎  𝒶  𝒱𝒶𝓁𝑒𝓃𝓉𝒾𝓃𝑒💘 
